import { useState } from "react";
import axios from "axios";
import cheerio from "cheerio";

const [data, setData] = useState([]);
const links = [];
axios
  .get("https://podzial.mech.pk.edu.pl/")
  .then((urlResponse) => {
    const $ = cheerio.load(urlResponse.data);

    $("td.l").each((i, element) => {
      links.push(element);
    });
    setData(links);
  })
  .catch((e) => console.log(e));
